import InternalLayout from '../components/InternalLayout';
import Table from '../components/Table';
import { Button, Icon } from 'semantic-ui-react';

export default () => {
    return (
    <InternalLayout adminFlag='y'>
        <Table></Table>
        <Button icon>
            <Icon name='plus' />
            Add New User
        </Button>
    </InternalLayout>);
}
